syntax = "proto2";
option optimize_for = LITE_RUNTIME;

package tabs_pb;
option java_package = "org.chromium.chrome.browser.tabs.proto";

// A 128-bit token.
message Token {
  optional fixed64 high = 1;
  optional fixed64 low = 2;
}
